import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

function Landing() {
  return (
    <div>방문페이지(로그인전)<br />
      <Link to='./Reg'>로그인</Link>
      <Link to='./Register'>회원가입</Link>
    </div>
  )
}

export default Landing
